import { Box } from "@mui/material";

export default function VoiceCaller() {
    return (
        <Box p={3}>
            <Stack spacing={1} justifyContent="center">
                <Typography variant="h6" textAlign={"center"}>
                    Voice Caller
                </Typography>
                <Grid
                    container
                    spacing={4}
                    justifyContent="center"
                    border={"2px solid"}
                    borderRadius={3}
                    p={1}
                >
                    <Paper
                        item
                        xs={4}
                        sx={{
                            border: "1px solid",
                            height: "128px",
                            width: "128px",
                        }}
                    />
                    <Paper
                        item
                        xs={4}
                        sx={{
                            border: "1px solid",
                            height: "128px",
                            width: "128px",
                        }}
                    />
                    <Paper
                        item
                        xs={4}
                        sx={{
                            border: "1px solid",
                            height: "128px",
                            width: "128px",
                        }}
                    />
                </Grid>
            </Stack>
        </Box>
    );
}
